  {name: 'Page A', queries: 400},
  {name: 'Page B', queries: 600},
  {name: 'Page C', queries: 800},
  {name: 'Page D', queries: 1200},
];

const QueriesCard = () => {
  return (
    <Widget>
          <div class="col-xl-2 col-sm-4 col-6">

<div class="dt-card dt-card__full-height bg-warning">

  <div class="dt-card__body text-center py-6 px-4">
    <div class="media flex-column align-items-center">

      <span class="dt-avatar__outline size-80 border-geekblue mb-6"><i class="icon icon-orders icon-5x text-geekblue"></i></span>

      <div class="media-body">
        <h2 class="display-3 font-weight-semibold mb-2 init-counter text-geekblue">2,380</h2>
        <span class="d-block text-geekblue">Orders this year</span>
      </div>

    </div>
  </div>

</div>

</div>
    </Widget>
  );
};

export default QueriesCard;
